// src/App.js
import React from 'react';
import {
  Accordion, Button, Checkbox, DropMenu, Email, Footer,
  Header, InputField, MForm, Modal, Navbar, Pagination,
  Password, RadioButton, Textarea, Login, Dashboard, Register
} from './components';

import {
  BrowserRouter as Router,
  Switch,
  Route
} from 'react-router-dom';

import About from './pages/About';
import Contact from './pages/Contact';
import ErrorPage from './pages/ErrorPage';
import Home from './pages/Home';
import NotFound from './pages/NotFound';
import VehicleChecklist from './pages/VehicleChecklist';

import './App.css'; // Assuming you have a default styling file named App.css

function App() {
  return (
    <Router>
      <div className="App">
        <Header />
        <Navbar />
        <Switch>
          <Route exact path="/" component={Home} />
          <Route path="/about" component={About} />
          <Route path="/contact" component={Contact} />
          <Route path="/vehicle-checklist" component={VehicleChecklist} />
          <Route path="/login" component={Login} />
          <Route path="/dashboard" component={Dashboard} />
          <Route path="/register" component={Register} />
          <Route path="/error" component={ErrorPage} />
          <Route path="*" component={NotFound} />
        </Switch>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
